import { useState, useEffect } from 'react';
import './App.css';

<script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.1/jquery.min.js"></script>

let API_KEY = 'e0a3dfaead51bbda58049371909fe21f';

function getWeather(latitude, longtitude) {
  $.ajax({
    url: 'http://api.openweathermap.org/data/2.5/weather',
    data: {
      lat: latitude,
      lon: longtitude,
      units: 'imperial',
      APPID: API_KEY
    },
    success: data => {
       console.log(data["main"]["temp"] + " F");
    }
  })
}

function App() {
  //state
  const [apiData, setApiData] = useState({});
  const apiKey = process.env.REACT_APP_API_KEY;
  const apiUrl = `https://api.openweathermap.org/data/2.5/weather?q=${'shanghai'}&appid=${apiKey}`;

  //data
  useEffect(() => {
    fetch(apiUrl)
      .then((res) => res.json())
      .then((data) => setApiData(data));
  }, [apiUrl]);

  console.log(apiData)
  console.log(getWeather(40.863372, -74.113181));

  return (
    <div className="App">

    </div>
  );
}

export default App;
